import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NavMenu from './NavMenu';
import CodingPage from './CodingPage'; // Import the Coding Page
import ComicsPage from './ComicsPage'; // Example placeholder
import ContactPage from './ContactPage'; // Example placeholder

function App() {
  return (
    <Router>
      <NavMenu />
      <Routes>
        <Route path="/coding" element={<CodingPage />} />
        <Route path="/comics" element={<ComicsPage />} />
        <Route path="/contact" element={<ContactPage />} />
        <Route path="/" element={<h1>Welcome to My Portfolio</h1>} /> {/* Home Page */}
      </Routes>
    </Router>
  );
}

export default App;
